// SPDX-License-Identifier: MIT

pragma solidity 0.8.10;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import '@aave-core/contracts/interfaces/IPoolAddressesProvider.sol';
import '@aave-core/contracts/interfaces/IPool.sol';

contract ContributorLender is Ownable {

    address public admin;
    address[] public contributors;
    mapping(address => mapping(address => uint256)) public contributions;
    IPoolAddressesProvider public poolProvider;
    address public poolAddress;
    IPool public lendingPool;

    constructor() public {
        admin = msg.sender;
    }

    // User deposits funds
    function contribute(address _token, uint256 _amount) public {
        require(_amount > 0, "You need to spend something.");
        IERC20(_token).transferFrom(msg.sender, address(this), _amount);
        contributors.push(msg.sender);
        contributions[msg.sender][_token] += _amount;
    }

    // User withdraw funds
    function withdraw(address _token, uint256 _amount) public {
        require(_amount > 0, "You need to withdraw something.");
        require(_amount <= contributions[msg.sender][_token], "You cannot withdraw more than what you contributed.");
        IERC20(_token).transferFrom(address(this), msg.sender, _amount);
        contributors.push(msg.sender);
        contributions[msg.sender][_token] -= _amount;
    }

    // DAO distributes to someone
    function distribute(address _token, address _beneficiary, uint256 _amount) public onlyOwner {
        IERC20(_token).transfer(_beneficiary, _amount);
    }

    // Get lending pool
    function setLendingPool(address _poolProvider) public onlyOwner {
        poolProvider = IPoolAddressesProvider(_poolProvider);
        poolAddress = poolProvider.getPool();
        // lendingPool = IPool(lendingPoolProvider.getPool());
    }


    // 2) stake amount to lending pool
    // 3) liquidate lending
    // 4) return amount to user

    // Option: collateral swap?


}
